export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},z2mloWcMuC:{data:{id:2468,attributes:{imdbId:"tt0066540",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMWFhMzcwZDMtYTJhZi00ZDBmLWEwNGQtZmMzN2U1ZDNiNjk1XkEyXkFqcGdeQXVyMjUxODE0MDY@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.5\u002F10"}],item_lang:{data:{id:3131,attributes:{title:"WUSA",plot:"Rheinhardt, a cynical drifter, gets a job as an announcer for right-wing radio station WUSA in New Orleans. Rheinhardt is content to parrot WUSA's reactionary editorial stance on the air, even if he doesn't agree with it. Rheinhardt finds his cynical detachment challenged by a lady friend, Geraldine, and by Rainey, a neighbor and troubled idealist who becomes aware of WUSA's sinister, hidden purpose. And when events start spinning out of control, even Rheinhardt finds he must take a stand.",slug:"wusa"}}},books:{data:[{id:11927,attributes:{title:e,description:h,thumbnail:i,authors:[c],firstBook:true,published:j,publisher:k,subtitle:a}},{id:11928,attributes:{title:e,description:h,thumbnail:i,authors:[c],firstBook:d,published:j,publisher:k,subtitle:a}},{id:11929,attributes:{title:"A Flag for Sunrise",description:"An emotional, dramatic and philosophical novel about Americans drawn into a small Central American country on the brink of revolution.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WJ5nGw3AKZkC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2012-04-04",publisher:l,subtitle:a}},{id:11930,attributes:{title:"Children of Light",description:"By \"one of the most impressive novelists of his generation\" (The New York Review of Books), Children of Light is a searing, indelible love story of two ravaged spirits, played out under the merciless, magnifying prism of Hollywood. Gordon Walker, screenwriter and actor, has systematically ruined his family and his health with cocaine and alcohol. Lee Verger is an actress of uncommon and unfulfilled promise, whom Gordon has known since the days when they were both young and fearless, and whose New Orleans childhood has left her with a tenuous hold on sanity. During the shooting of a film on the Pacific coast of Mexico, they resume a ritual struggle in which their desperate love for each other will either save or destroy them.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tJisfG5XjfAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2012-01-04",publisher:l,subtitle:a}},{id:11931,attributes:{title:e,description:a,thumbnail:a,authors:["Robert STONE (Novelist.)"],firstBook:d,published:"1968-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681377204629}}("","movie","Robert Stone",null,"A Hall of Mirrors","series",1,"Rheinhardt, a disk jockey and failed musician, rolls into New Orleans looking for work and another chance in life. What he finds is a woman physically and psychically damaged by the men in her past and a job that entangles him in a right-wing political movement. Peopled with civil rights activists, fanatical Christians, corrupt politicians, and demented Hollywood stars, A Hall of Mirrors vividly depicts the dark side of America that erupted in the sixties. To quote Wallace Stegner, \"Stone writes like a bird, like an angel, like a circus barker, like a con man, like someone so high on pot that he is scraping his shoes on the stars.\"","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=BlEcFf_OfTYC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","1997-01-01","Houghton Mifflin Harcourt","Vintage"))